A visual guide to learning to bake, with more than 850 photos. Better Homes and Gardens Baking Step by Step is the ultimate guide and idea-generator for anyone who wants to learn to bake or hone their technique. 

This stunning book uses clear, step-by-step photos-more than 900 of them-to illustrate essential skills from folding batter to forming a lattice pie crust. Home bakers can make 350 classic and modern treats, both sweet and savory
